import React from 'react'
import { connect } from 'react-redux'

/*IMAGES*/

import Img1 from '../plantilla/img/clients-logo/c-logo-1.png'
import Img2 from '../plantilla/img/clients-logo/c-logo-2.png'
import Img3 from '../plantilla/img/clients-logo/c-logo-3.png'
import Img4 from '../plantilla/img/clients-logo/c-logo-4.png'
import Img5 from '../plantilla/img/clients-logo/c-logo-5.png'



const ClientLogo = ({ImgLOGO}) =>{

    const textJVX = []

    const repeat = () =>{
        
        ImgLOGO.forEach((image, index) => {
            textJVX.push(                        
            <div className="item" key={index} >
                <img src={image} alt=""/>
            </div>)
        });
    }
    repeat()

    return(
            <section className="clients_logo_area">
                <div className="container">
                    <div className="main_title">
                        <h2> Las Marcas más usadas este Mes</h2>
                        <p>Las más vendidas y recomendadas por los usuarios</p>
                    </div>
                    <div className="clients_slider row ">
                        {textJVX}
                    </div>
                </div>
            </section>
    )
}

const mapStateToProps = state =>({
    ImgLOGO : state.CLReducer
})

export default connect(mapStateToProps,{})(ClientLogo)
